⁣
An OG combo made a little lighter 😌😌⁣
I love waffles and ice cream, this is super easy to make for a delicious dessert that’s a little lower in calories ⁣
⁣
Ingredients:⁣
•53 grams @kodiakcakes Power Mix⁣
•Vanilla extract
• @edys Slow Churned Ice cream⁣ (I used Peanut Butter Cup)
⁣
How to Make:⁣
1. Add water, and a splash of vanilla to 53 grams of Kodiak cake mix (this should be like pancake batter)⁣
2. Using a waffle iron, add the batter and wait for the light to turn!! ⁣
I LOVE this Dash mini waffle iron but if you don’t have one you can just use a normal one⁣
3. Pair with some delicious ice cream !!!⁣
⁣
@edys has a great selection of macro friendly ice creams !! They not high protien but lower in calories ! This is the slow churned Peanut Butter Cup 😍😍⁣
⁣
